import React from 'react';
import ReactDOM from 'react-dom/client';


var root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

    <React.Fragment>
        <h1>JSX Attributes</h1>
        <img src='https://picsum.photos/200/300' alt="Random Images"/>
        <img src='https://picsum.photos/200/300' alt="Random Images"/>
        <img src='https://picsum.photos/200/300' alt="Random Images"/>

    </React.Fragment>

);
